import React, { ReactElement } from 'react'
import {User} from '../../App'
import './Welcome.css';


interface Props {
    activeUser: User
};

export default function Welcome({activeUser}: Props): ReactElement {
    return (
        <div>
            <h1 className = 'welcome-title'>Welcome to One Million KBTU Stories {activeUser.name} {activeUser.surname}!</h1>
            <h3></h3>
        </div>
    )
}
